'''Tutab''' is a monkey merchant who sells [[magical]] items on [[Ape Atoll]] at his stall, [[Tutab's Magical Market]]. It can only be used after completion of [[Monkey Madness I]], and whilst wielding a [[greegree]] and [[Monkeyspeak amulet]].

His shop is the only way to obtain another [[monkey talisman]], other than talking to the [[Monkey Child]]. At 65 [[Thieving]] and whilst in [[human]] form, players can steal from his [[magic stall]], granting 100 Thieving [[experience]] and one of the four elemental runes ([[air rune|air]], [[fire rune|fire]], [[water rune|water]], [[earth rune|earth]]) or a [[law rune]]. It takes about 40 seconds before it can be pilfered again.

